import logo from './logo.svg'
import './App.css'
import axios from 'axios'
import React, {useState, useEffect} from 'react'

import { CustomNavbar } from './mainComponents/CustomNavbar'
import { CustomFooter } from './mainComponents/CustomFooter'
import { Container, Header, Content, Footer, Sidebar } from 'rsuite'

import { Card } from '@consta/uikit/Card'
import { Text } from '@consta/uikit/Text'
import { Button } from '@consta/uikit/Button'
import { Grid, GridItem } from '@consta/uikit/Grid'


function App() {
    const [posts, setPosts] = useState([])

    const [valueError, setValueError] = useState('')

    useEffect(() => {
        axios({
            method: 'GET',
            url: window.location.origin+'/api/test/',
        }).then(response => {
            //setPosts(JSON.parse(response.data['posts']))
            console.log(JSON.parse(response.data['posts']))
        }).catch(error => {
            console.log(error)
            setValueError('Quasi per errorem inciderunt')
        })
    }, [])

    return (
        <div className="show-container" >
            <Container>
                <Header>
                    <CustomNavbar/>
                </Header>
                <Content className='main-container' >
                    {posts.map((post, index) => (

                            <Card >
                                <Grid cols='12'>
                                    <Text >
                                        {post.title}
                                    </Text>
                                </Grid>
                            </Card>

                    ))}
                </Content>
                <CustomFooter />
            </Container>
        </div>
    )
}

export default App;
